INSERT INTO `knowledge` (`KID`, `KPID`, `KIndex`, `KClass`, `KTitle`, `KDescription`, `KContent`, `KVisitTime`, `KUsefulTime`, `KUselessTime`) VALUES
(1, 1, 0, '雨具', '天堂伞知识库示例标题', '  天堂伞知识库示例描述  ', '  天堂伞知识库示例内容  ', 1, 0, 0),
(2, 2, 0, '文具', '文具盒知识库示例标题', '  文具盒知识库示例描述  ', '  文具盒知识库示例内容  ', 0, 0, 0),
(3, 4, 1, '雨具', '雨衣材料', '雨衣由什么材料组成？', '雨衣，一般指由防水布料制成的挡雨衣服。雨衣适用的防水布料有胶布、油布和塑料薄膜等。', 0, 0, 0),
(4, 5, 1, '雨具', '雨靴种类', '目前为止雨靴有多少种类？', '现如今的雨靴，已经一改往日的传统形象，再也不是给人笨重呆板闷热不透气的印象，它们采用最优质的进口天然橡胶原料，除了保留传统雨靴的防水防滑的特殊功能外，穿上了时尚的外衣，还为雨靴增添了不同的色彩图案，如古典印花，苏格兰格，点点以及秋冬季大热的豹纹蛇纹等图案。', 0, 0, 0),
(5, 6, 1, '帽类', '帽子材料', '帽子有什么材料？', '按具体的要求大致可分为全棉、涤纶、TC、CVC、尼龙、皮、绒、草类、PVC、不织布、纸。但常用的面料以布料为主，量大要求价格较时大多使用PVC、不织布和纸帽。', 0, 0, 0),
(6, 1, 0, '雨具', '雨伞面料', '雨伞有什么面料？', '平常我们所见到的一些户外太阳伞用的布料大至分为，涤纶布，牛津布，帆布。涤纶布是遮阳性和防腐性最好的，价格也相对实惠，牛津布防水性比较好，但价格高了一点。高然涤纶布也可做的很高档，比如用PA，PU， UV， 涂层这样伞的质感好了，也能真正起到三防的作用。', 5, 0, 0),
(7, 1, 1, '雨具', '雨伞使用次数', '一年到底需要几把伞？', '这个情况因人而异，爱伞一族可根据自身情况购置自己喜欢的伞具。一般来说，遮雨伞是人手必备的，可适当选购晴雨用的晴雨伞和漂亮防晒的遮阳伞。', 43, 3, 1),
(8, 1, 0, '雨具', '雨伞设计', '为什么绣花伞的边缘很多镂空网纱设计，会不会影响防晒效果？', '处于对设计的考虑，设计师会加入一些镂空网纱蕾丝花边等等设计，虽然会有小部分伞面感觉会透光， 实际上大部分阳光会被伞面的反光膜反射出去，因此影响甚小。', 4, 0, 0),
(9, 3, 1, '洗浴', '毛巾颜色', '毛巾的颜色对使用人群有讲究吗?', '毛巾深色的比浅色的成本高，毛巾浅色的比深色耐用。因为深色的成本高，也就是投入的化学品，染色时间要高。所以对纤维的损伤就大。而且颜色越深，牢度越差。儿童最好用浅色的。不要买带绣花的毛巾。', 0, 0, 0),
(10, 3, 1, '洗浴', '毛巾去污', '毛巾沾染污渍怎么办？', '去除油污：把毛巾放入盆里，放些食用碱面，再放入开水泡10分钟，油油就泡出去了，用热水洗净晾干，特别干净。\r\n去除果汁：在果汁处加点牙膏，然后搓洗，用水洗净就好了。', 0, 0, 0),
(11, 3, 0, '洗浴', '毛巾异味？', '毛巾有异味怎么办？', '使用后一定要用清水充分洗净；\r\n定期用洗涤剂清洗；\r\n使用后一定要放在通风处晾干；\r\n可以选用经过灭菌处理的毛巾或者选用竹纤维毛巾、甲壳素纤维毛巾、竹炭纤维毛巾；\r\n也是最重要的一点，毛巾不可久用不换，最好一个月更新一次。\r\n可以用碱水清洗以外，还可以将毛巾放在浓盐水中煮或烫洗。', 0, 0, 0),
(12, 3, 0, '洗浴', '毛巾变硬', '  毛巾使用过一段时间后就会变得很硬，很粗糙，不像刚开始那样柔软，怎样才能使毛巾保持柔软呢？  ', '  将淘米水（第一、二遍）倒入锅中，把毛巾放进去煮，烧开后再多煮一会就行了。经过这样做的毛巾会变白，变柔软，变得比原来厚，会有淡淡米香。\r\n把毛巾放在洗涤液热水中，煮或烫5分钟后，再趁热洗干净就可以了。\r\n毛巾常洗且每隔一段时间用肥皂、洗衣粉或碱液煮沸数分钟，可防发硬。煮沸时毛巾应全部浸水中，以免与空气接触发生氧化而降低柔软度。\r\n在洗毛巾时，将毛巾放入搭有浓肥皂液，醋水或碱水中煮沸片刻，煮的时候应该使皂液淹没毛巾。然后再用清水，温水依次漂洗数次，带着水晾于通风处。晾干后，毛巾就会恢复柔软。需要提醒的是毛巾不可长久地在太阳下曝晒，一般晾在通风处自然晾干比较好。\r\n毛巾科学消毒法：将毛巾先用开水煮沸10分钟左右，再用肥皂洗涤，然后用清水充分洗净，最后将毛巾折叠好放入微波炉中，加热5分钟。\r\n最好的方法是使用醋精，将醋精放在1：4的溶液里，水量不要多，漫过毛巾就行，浸泡5分钟后，再进行搓洗而后用清水漂洗干净即可。  ', 0, 0, 0),
(13, 3, 1, '洗浴', '毛巾用处', '人们居家旅游，总免不了要同毛巾打交道。通常用它擦手、擦脸、除汗去污。然而，您可曾晓得它还有什么妙用？', '在饭店里人们使用煤气或液化石油气烧水做饭，如常备一条浸湿的毛巾，放在身边，万一煤气管道或液化石油气喷嘴漏气失火，用湿毛巾往上一扑即灭，赶紧关闭阀门，就可避免一场火灾。\r\n厨师炒菜做饭时身边常放一条湿毛巾，万一油锅起火迅速罩于其上，火就会即刻熄灭。\r\n在特定的情况下一条湿毛巾还可以顶一个防毒面具使用。秘密在于，毛巾具有除烟效果。在火灾的浓烟中避难时，可以用一块毛巾捂住嘴和鼻孔，迅速冲出火场可以死里逃生。试验证明，毛巾的折叠层数越多除烟效果越好，但在大火的紧急时刻考虑到以折8层为限，这时其除烟率约60%。在浓烟的场所，由于烟颗粒大，附着堵塞在毛巾的网络上，因此除烟率随着时间的增长而增大。用8折的毛巾实验，3～4分钟后，除烟率达100%，当然透气阻力也同时增大。用不同湿度的毛巾，除烟率也各不相同，含水量越大，除烟率也越大。含水量达毛巾的3．3信时，人们的忍耐时间为1分20秒左右。', 0, 0, 0),
(14, 7, 1, '文具', '铅笔知识库', '铅笔知识库', '铅笔知识库', 0, 0, 0),
(15, 8, 1, '文具', '铅笔刀知识库', '铅笔刀知识库', '铅笔刀知识库', 0, 0, 0),
(16, 9, 1, '文具', '尺子知识库', '尺子知识库', '尺子知识库', 0, 0, 0),
(17, 1, 0, 'root', '反向雨伞是什么？', NULL, '反向雨伞可以反向收起，其发明者是 61 岁的英国发明家 Jenan Kazim。这种雨伞的打开与合拢的方向相反，它能够很好的排出积聚在伞内的雨水。方向雨伞同时避免了伞骨戳到路人脑袋的尴尬。发明者表示，新的设计意味着使用者一旦把伞收起来，就能保持长时间的周身干爽，同时还能避免在强风中受伤。\r\n这种伞收起来的时候是将里面干燥的伞面翻到了外面而且这个过程你需要向上撑，而不是像普通伞一样向下拉。它不会让使用者一回家就搞得一地雨水，你也不用费力为了撑伞将它举过头顶。它不会戳到人脸，一旦你坐进车里就能顺利的把伞收了，还不会蹭到雨水。这把伞不会被风吹的里朝外，因为里面的伞面早就翻到外面了。', 14, 0, 1);

